function wowhead_list_to_us($list)
{
	$ret="";
	$pieces = explode("{id:",$list);
	foreach($pieces as $key =>$val )
	{
		$id = explode(",",$val);
		$id = $id[0];
		if( $id<1)
			continue;
		$ret.=$id.",";
	}
	return $ret;
}
